import React from "react";

const SignUp = () => {
  const submit = () => {
    console.log("On Submit called");
  };
  return (
    <div className="container">
      <div className="row">
        <form onSubmit={submit}></form>
      </div>
    </div>
  );
};

export default SignUp;
